import "./TodoList.css";

export default function TodoList({ todo }) {
  return (
    <ul className="TodoList__list">
      {todo.map(
        ({ id, text, completed }) =>
          completed && (
            <li className="TodoList__item" key={id}>
              {text}{" "}
              <button className="TodoList__button" type="button">
                Delete
              </button>
            </li>
          )
      )}
    </ul>
  );
}
